zoomin cross-center\" style=\"animation-delay: 1.3s\"><input type=\"image\" src=\"[art-path]images/search.svg\"  class=\"hover\" style=\"width: 40px; margin-left: 10px;\"></div>\r\n            </form>\r\n        </div>\r\n    </div>\r\n    <!--    TABLET AND LARGE DEVICES HEADER END   -->\r\n    <!--    SMART PHONES AND SMALL DEVICES HEADER START   -->\r\n    <div class=\"header d-md-none cross-center\">\r\n        <div class=\"col-7 cross-center\">\r\n            <img class=\"site-logo\" src=\"[art-sitelogo]\">\r\n        </div>\r\n        <div class=\"col-5 cross-center end\">\r\n            <a href=\"#menu\"><img src=\"[art-path]images/search.svg\" style=\"width:40px;\"></a>\r\n            <a href=\"#menu\"><img src=\"[art-path]images/menu-burger.svg\" style=\"width:40px;\"></a>\r\n        </div>\r\n    </div>\r\n    <!--    SMART PHONES AND SMALL DEVICES HEADER END   -->\r\n    <!--    CONTENT START   -->\r\n    [art-contents]\r\n    <!--    CONTENT END   -->\r\n</div>\r\n<!--    STICKY FOOTER END   -->\r\n<!--    FOOTER START    -->\r\n<div class=\"container\">\r\n    <div class=\"row footer\">\r\n        <div class=\"col-md-12 col-lg-4\">\r\n            <!--    SITELOGO    -->\r\n            <div class=\"footer-site-logo\">\r\n                <a href=\"[art-home]\"><img class=\"site-logo\" src=\"[art-sitelogo]\" style=\"width: 100%; max-width:220px;\"></a>\r\n            </div>\r\n            <!--    FEATURES, MISSION STATEMENT, ANYTHING YOU WISH TO ADD FOR YOUR WEBSITE ETC.  -->\r\n            <p>\r\n                Create a business website that will showcase the full potential of your company with a responsive website builder. With Blue Gravity, you get a rich set of user-friendly tools to make your business grow online.\r\n            </p>\r\n        </div>\r\n        <div class=\"col-md-12 col-lg-4\">\r\n            <!--    CONTACT OR ADDRESS  -->\r\n            <div class=\"footer-heading\">ADDRESS</div>\r\n            <p>[art-address]</p>\r\n        </d